    class MinIncrement
    {
        public static int MinIncrementForUnique(int[] A)
        {
            Array.Sort(A);
            Dictionary<int, int> pairs = new Dictionary<int, int>();
            int counter = 0;
            for (int i = 0; i < A.Length; i++)
            {
                if (pairs.ContainsKey(A[i]))
                {
                    while (pairs.ContainsKey(A[i]))
                    {
                        int temp = A[i];
                        A[i] = A[i - 1] + 1;
                        counter += A[i] - temp;
                    }
                }
                pairs.Add(A[i], 1);
            }
            return counter;
        }
